import './style.css';
import React from 'react';


const Receipt = () => {

    return (
        <div className='receipt'>
         <div>영수증</div>
         <div>주문 번호</div>
         <div> 상품 수량 가격 </div>
         <div> 아메리카노 2개 3000원</div>
         <div> 총가격</div>
         <div> 
            10초뒤 매인화면 
         </div>
            <button>결제 취소</button> 
        </div>
    );
};

export default Receipt;
